import React from "react";
import "../../App.css";



export default function AboutUs() {
  return (
    <>
      <h1 className="aboutus"> ABOUT US </h1>
      <div id="We_currently_have__more_than_3">
			<span>We currently have <br/>more than </span><span style="font-size:80px;">300 members</span><span> </span>
		</div>
		<div id="which_lead_us_to_be__the_large">
			<span>which lead us to be <br/>the largest Chinese student society in UTAS</span>
		</div>

    </>
  );
}
